CREATE DEFINER=`mm_team05_01`@`%` PROCEDURE `GetIllnessesWithoutDoctorVisits`()
BEGIN
    SELECT 
        id.illness_id,
        id.description AS IllnessDescription
    FROM 
        Illness_Details id
    WHERE NOT EXISTS (
        SELECT 1
        FROM Patients_has_Illness_Details phi
        INNER JOIN Patients_has_Staff phs ON phi.Patients_patient_id = phs.Patients_patient_id
